import React from 'react';


const AvailableItem = ({ label, onToggleImportant, onToggleDone, onDelete }) => {


    return (
        <span >
      <span
          className=""
          onClick={onToggleDone}>{label}</span>

      <button type="button"
              className="btn"
              value="Rent"
              onClick={onToggleImportant}>

      </button>

      <button type="button"
              className="btn"
              onClick={onDelete}>
      </button>
    </span>
    );
};

export default AvailableItem;
